import ReactDOM from 'react-dom';


function Hello(props){
  return <p>Hello, {this.props.name}!</p>;
}
function App(){
  return <div>
    <Hello name="James"/>
    <Hello name="David"/>
    <Hello name="Amy"/>
  </div>;
}

const el = <App  />;
ReactDOM.render(
  el, document.getElementById('root')
);
